pr_body:
This PR removes the stars function from `challenge-card` component from `challenge-list` page.
This reduces the number of requests (5.5 sec to 1.5 sec though this number is based on the number of challenges I have on my local system)

@Ram81 @Kajol-Kumari

This PR adds lazy loading on images and the images of the challenges are now loaded when the viewport changes, hence as the user moves down the logos are displayed.
@Ram81 @Kajol-Kumari 


https://user-images.githubusercontent.com/24366008/129788273-47d702e7-1e60-4c92-a251-d894c1b958e5.mp4

**Fix:** Serial number is visible when moving to next page in `All submissions` and `My Submissions` tab

![Screenshot from 2021-05-23 15-17-38](https://user-images.githubusercontent.com/24366008/119256121-b5123280-bbdc-11eb-9de0-2304aa8c5db4.png)


@Ram81 @Kajol-Kumari

When `Include Private Submission` is checked the private submissions are not fetched after 5seconds of polling. 
Also, when the leaderboard has all private submissions, previously no results are shown, but now the checkbox is also visible.

@Ram81 @Kajol-Kumari

Added tests for the components which were not included
Tests for few edit features were at different components. Moved it to settings tab.
@Ram81 @Kajol-Kumari
